# === H√ÄM GI·∫¢I M√É CHU·ªñI BASE64 V√Ä L∆ØU TH√ÄNH ·∫¢NH ===
def decode_base64_to_image(base64_string, folder="images"):
    if not os.path.exists(folder):
        os.makedirs(folder)

    try:
        image_data = base64.b64decode(base64_string)
        np_arr = np.frombuffer(image_data, np.uint8)
        image = cv2.imdecode(np_arr, cv2.IMREAD_COLOR)

        if image is None:
            print("‚ùå Gi·∫£i m√£ Base64 th·∫•t b·∫°i!")
            return None

        filename = f"{folder}/plate_{datetime.now().strftime('%Y%m%d_%H%M%S')}.jpg"
        cv2.imwrite(filename, image)
        print(f"‚úÖ ·∫¢nh ƒë√£ l∆∞u: {filename}")
        return filename
    except Exception as e:
        print(f"‚ùå L·ªói gi·∫£i m√£ Base64: {e}")
        return None


# === H√ÄM NH·∫¨N DI·ªÜN BI·ªÇN S·ªê ===
def detect_license_plate(image_path):
    results = model(image_path)
    image = cv2.imread(image_path)
    image_info = results[0]
    boxes = image_info.boxes.data.cpu().numpy()

    plate_number = None
    for i, box in enumerate(boxes):
        x_min, y_min, x_max, y_max = map(int, box[:4])
        cropped_image = image[y_min:y_max, x_min:x_max]
        gray_image = cv2.cvtColor(cropped_image, cv2.COLOR_BGR2GRAY)
        blurred_image = cv2.GaussianBlur(gray_image, (5, 5), 0)

        # Nh·∫≠n di·ªán b·∫±ng Tesseract
        text = pytesseract.image_to_string(blurred_image, config="--psm 6")
        text = re.sub(r'[^a-zA-Z0-9]', '', text)

        # Nh·∫≠n di·ªán b·∫±ng EasyOCR
        reader = easyocr.Reader(['en'])
        result_easyocr = reader.readtext(gray_image, detail=0, paragraph=True)
        easyocr_text = ''.join(re.findall(r'[a-zA-Z0-9]', ''.join(result_easyocr)))

        plate_number = easyocr_text if len(easyocr_text) > len(text) else text

    return plate_number


